import React from "react";
import {
  Navbar, NavbarBrand, Collapse, Nav, NavItem, NavLink, NavbarToggler,
  UncontrolledDropdown, DropdownToggle, DropdownMenu, DropdownItem, NavbarText
} from "reactstrap";

const NavBar = () => {
  return (
    <div>
      <Navbar className="navbar navbar-expand-lg navbar-light bg-warning py-3 shadow-sm">
        <NavbarBrand className="navbar-brand fw-bold fs-3" href="/">
            Amazon
        </NavbarBrand>
        <Collapse navbar>
          <Nav className="me-auto" navbar>
            <NavItem>
              <NavLink href="/components/">Components</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="https://github.com/reactstrap/reactstrap">
                GitHub
              </NavLink>
            </NavItem>
          </Nav>
          <NavbarText>Simple Text</NavbarText>
        </Collapse>
      </Navbar>
    </div>
  );
};

export default NavBar;
